import "./Movie.css";

interface Movie {
  poster?: string;
  title: string;
  crawl: string;
  date: string;
}

const Movie: React.FC<Movie> = ({ poster, title, crawl, date }) => {
  return (
    <div className="movie__card">
      <img src={poster} alt="Movie Poster" />
      <div className="movie__description">
        <p>{title}</p>
        <p> Release date: {date}</p>
        <span> {crawl}</span>
      </div>
    </div>
  );
};

export default Movie;
